import React, {Component} from 'react';
import Easy from './components/gamelevels/easy';
import Medium from './components/gamelevels/medium';
import Master from './components/gamelevels/master';
import AppHeader from './components/AppHeader/AppHeader';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import { Link } from "react-router-dom";

import './App.css';
import './components/AppHeader/AppHeader.css';
class App extends Component {
  render() {
    return (
      <Router className="title" >
        <Route path="/" exact component={AppHeader} />
        <Route path="/easy" exact component={Easy} />
        <Route path="/medium" exact component={Medium} />
        <Route path="/master" exact component={Master} />
        <Route path="/about" exact component={() => (
          <article className="App">
            <nav>
              <Link to="/">Memory Game</Link><br/>
            </nav>
            <h2>About this app</h2>
            <p>
              Lorem ipsum dolor sit amet, consectetur adipiscing elit.
              Nulla dignissim lectus diam, sit amet suscipit elit lacinia vitae.
              Sed rhoncus mattis ipsum at rhoncus.
              Donec condimentum, ipsum ac sollicitudin hendrerit,
              felis elit ultricies sapien, molestie placerat ligula metus ut tortor.
            </p>
          </article>
        )}>
        </Route>
      </Router>
    )
  }
}

export default App;
